DROP TABLE IF EXISTS `tbl_backups`;

CREATE TABLE `tbl_backups` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `filename` varchar(255) NOT NULL,
  `tables` text,
  `description` text,
  `slug` varchar(255) NOT NULL,
  `record_status` tinyint(2) NOT NULL DEFAULT '1',
